	@Test
	public void butterIniCTest() {
		double[][] butExp = new double[10][];
		
		butExp[0] = new double[]{1, -1};
		butExp[1] = new double[]{1, 1, 0.70711};
		butExp[2] = new double[]{1, 1, 1, -1};
		butExp[3] = new double[]{1, 1, 1.3066, 1, 0.5412};
		butExp[4] = new double[]{1, 1, 1.618, 1, 0.61803, -1};
		butExp[5] = new double[]{1, 1, 1.9319, 1, 0.70711, 1, 0.51764};
		butExp[6] = new double[]{1, 1, 2.247, 1, 0.80194, 1, 0.55496, -1};
		butExp[7] = new double[]{1, 1, 2.5629, 1, 0.89998, 1, 0.60134, 1, 0.5098};
		butExp[8] = new double[]{1, 1, 2.8794, 1, 1, 1, 0.6527, 1, 0.53209, -1};
		butExp[9] = new double[]{1, 1, 3.1962, 1, 1.1013, 1, 0.70711, 1, 0.56116, 1, 0.50623};
		
		for (int i = 0; i < butExp.length; i++) {
			assertArrayEquals("ButterCheck " + (i+1) + ".Ordnung", butExp[i], tester.butterIniC(1, i+1, 10), abw);
		}		
	}
	
